import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Link } from 'react-router-dom';
import { ucitajNastavnika } from '../redux/nastavnici/actions';

const Nastavnik = (props) => {
  const nastavnik = useSelector((state) => state.nastavnik);
  const dispatch = useDispatch();

  return (
    <div>
      <p>
        {props.ime} {props.prezime}
      </p>
      <Link
        to={'/nastavnici/' + props.id}
        onClick={() => {
          dispatch(ucitajNastavnika(props.id));
        }}
      >
        Details
      </Link>
      {nastavnik}
    </div>
  );
};

export default Nastavnik;
